import React from 'react';
import './Contact.css';

const Contact = () => {
  return (
    <section id="contact" className="contact">
      <div className="contact-card">
        <div className="contact-info">
          <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" strokeWidth="1.5" stroke="currentColor" className="icon">
            <path strokeLinecap="round" strokeLinejoin="round" d="M21.75 12a9.75 9.75 0 11-19.5 0 9.75 9.75 0 0119.5 0z" />
            <path strokeLinecap="round" strokeLinejoin="round" d="M16.5 15.75l-4.5-3-4.5 3V8.25l4.5 3 4.5-3v7.5z" />
          </svg>
          <span>Get in touch</span>
          <span className="divider">|</span>
          <a href="mailto:lifewithryans@gmail.com" className="email-link">Email â†’</a>
        </div>
      </div>
      <div className="social-icons">
        <a href="https://www.linkedin.com/in/your-linkedin-profile" target="_blank" rel="noopener noreferrer">
          <img src="linkedin-icon-url" alt="LinkedIn" className="social-icon" />
        </a>
        <a href="https://github.com/your-github-profile" target="_blank" rel="noopener noreferrer">
          <img src="github-icon-url" alt="GitHub" className="social-icon" />
        </a>
      </div>
    </section>
  );
};

export default Contact;
